    function timeConvertor(tme) {
        var PM = tme.match('PM') ? true : false

        tme = tme.split(':')
        var min = tme[1]

        if (PM) {
            var hour = 12 + parseInt(tme[0], 10)
            var sec = tme[2].replace('PM', '')
        } else {
            var hour = tme[0]
            var sec = tme[2].replace('AM', '')
        }
        return (hour + ':' + min + ':' + sec)
    }
